import React from "react";
import Gambar from "./2.jpg";

function Programming() {
  return (
    <div className="mark">
      <div className="flex items-center justify-center gap-3 p-5 pl-20">
        <div className="1 flex h-[20rem] w-[30rem]">
          <img src={Gambar} alt="" />
        </div>
        <div className="1 flex h-[20rem] w-full p-10">
          <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Voluptate animi dignissimos inventore obcaecati porro culpa delectus maxime aspernatur adipisci atque. Quam, voluptates fugit? Aut, voluptas eaque ab enim ad dolor!</p>
        </div>
      </div>
    </div>
  );
}

export default Programming;
